<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <link
      rel="stylesheet"
      href="https://fonts.googleapis.com/css2?family=Inter:wght@500"
    />
    <title>HTML Preview</title>
    <link rel="stylesheet" type="text/css" href="styles.css" />
    <link rel="stylesheet" type="text/css" href="compiled-styles.css" />
  </head>
  <body style="margin: 0px">
    <!-- This only removes default margins in our renderer iframe, you may remove -->
    <div id="firejet-html-app">
      <section class="component-component">
        <div class="component-ttt-label-ttarrow_drop_up">
          <div class="component-tt-label-ttarrow_drop_up">
            <div class="component-t-label">
              <aside class="component-label">Activity</aside>
            </div>
            <div class="component-tt-arrow_drop_up">
              <div class="component-t-arrow_drop_up">
                <object
                  data="/assets/Arrow_drop_up.svg"
                  class="component-arrow_drop_up"
                ></object>
              </div>
              <div class="component-component-1">+2.45%</div>
            </div>
          </div>
        </div>
        <div class="component-tt-cash-tlabel">
          <div class="component-t-cash-tlabel">
            <div class="component-cash">2.579</div>
            <div class="component-t-label-1">
              <aside class="component-label-1">Log Hours</aside>
            </div>
          </div>
        </div>
        <div class="component-t-rectangle-18rectangle-18rectangle-18rectangle-18rectangle-18rectangle-18rectangle" >
          <div class="component-wrapper">
            <div class="component-rectangle"></div>
          </div>
          <div class="component-wrapper-1">
            <div class="component-rectangle-1"></div>
          </div>
          <div class="component-wrapper-2">
            <div class="component-rectangle-2"></div>
          </div>
          <div class="component-wrapper-3">
            <div class="component-rectangle-3"></div>
          </div>
          <div class="component-wrapper-4">
            <div class="component-rectangle-4"></div>
          </div>
          <div class="component-wrapper-5">
            <div class="component-rectangle-5"></div>
          </div>
          <div class="component-wrapper-6">
            <div class="component-rectangle-6"></div>
          </div>
        </div>
        <div class="component-tttt-mon-tue-wed-thur-tfri-tsat-sun">
          <div class="component-ttt-mon-tue-wed-thur-tfri-tsat-sun">
            <div class="component-tt-mon-tue-wed-thur">
              <div class="component-t-mon-tue-wed-thur">
                <div>Mon</div>
                <div>Tue</div>
                <div>Wed</div>
                <div>Thur</div>
              </div>
            </div>
            <div class="component-t-fri-tsat-sun">
              <div>Fri</div>
              <div class="component-sat">Sat</div>
              <div>Sun</div>
            </div>
          </div>
        </div>
      </section>
    </div>
  </body>
</html>
